Context: The Latin names lectio brevior (shorter reading) and lectio difficilior (more difficult reading) are used to describe two different approaches to textual criticism. The first is the general observation that scribes tended to add words, for clarification or out of habit, more often than they removed them. The second, lectio difficilior potior (the harder reading is stronger), recognizes the tendency for harmonization—resolving apparent inconsistencies in the text. Applying this principle leads to taking the more difficult (unharmonized) reading as being more likely to be the original. Such cases also include scribes simplifying and smoothing texts they did not fully understand. 

Answer: The main principle of lectio brevior is that scribes tend to add words more often than they remove them. 

